  false,\n\t\"url\": null,\n\t\"notes\": \"Ruby Lake NWR 1987 Annual Water Management
  Report 1988 Annual Water Management Plan. Includes 1987 weather summary, water availability
  forecast, summary of 1987 water levels, water control improvements, effects of 1987
  water levels on the ecology of each. Mild November temperatures brought rain instead
  of the normal snow characteristic of this time of year. However, snow pack on the
  Ruby Mountains al this writing appears to be normal at high elevations (-6 ft.).
  Lower elevations though appear to have received slightly less than normal snow fall.
  Because it is generally thought to take two years for water to circulate through
  the system and reach the refuge and precipitation totals for 1986 and 1987 were
  below the average, refuge staff is expecting no excess of water for 1988.  After
  five years of high water, objective levels were once again reached in most units
  during late summer. Highest water levels (0.35-1.86 ft. above objective levels)
  were recorded during mid-March. With little precip1tation and high evaporation rates,
  water levels dropped rapidly throughout the summer. They continued to decrease until
  mid-October. Some diked units were lowered periodically from June through September
  to accommodate dredging operations and pipe and riser installations.\",\n\t\"license_title\":
